const Page =(props) => {
    const[input,setInput] = useState({
            input1: "",
            input2:""
        });
    const addnewNotes = props.addnewNotes


    const changeinput = (event) => {
    const {name,value,} = event.target
        setInput({...input,[name]:value})

    }

    const submit =(event)=> {
        event.preventDefault()
        addnewNotes(input)
        setInput({
            input1: "",
            input2: ""
        })

    }
    return (




        <form onSubmit={submit}>

            <input type={"text"} name={'input1'} id={"input1"} onChange={changeinput} value={input.input1}/>

            <input type={"text"} name="input2" id={"input2"} onChange={changeinput} value={input.input2}/>


            <button>add Note</button>
        </form>





    )


}
